import React, {Component} from 'react';

class Items extends Component{
    render(){
        const myItems = this.props.items.map((item) => {
            return(
                <div>
                    <p>{item.id}</p>
                    <p>{item.name}</p>
                    <p>{item.age}</p>
                </div>
            );
        })
        return(
            <div>
                {myItems};
            </div>
        );
    }
}

export default Items;
